import React from "react";
import { Route, Routes } from "react-router-dom";

const homeApp = () => {
    const [isLoggedin, setIsLoggedin] = useState(false);

    return (
        <div>
            <Routes>
                <Route path="/" element={isLoggedIn ? <Home /> : <Navigate to="/login"></Navigate>}/>
            </Routes>
        </div>
    )
}

export default homeApp;
